import React from 'react';

function Home() {
  return (
    <section className="home bg-light text-dark py-5">
      <div className="container text-center">
        <h2>Welcome to Car Care</h2>
        <p>Your one-stop solution for all car care services.</p>
      </div>
    </section>
  );
}

export default Home;
